import { useState, useEffect } from "react";
import utilities from "../js/utilities";

function ListBooks() {
  const [books, setBooks] = useState([]);
  useEffect(() => {
    fetch(utilities.SERVER_IP + "books/")
      .then((response) => response.json())
      .then((data) => {
        setBooks(data.map((x) => (
          <tr>
            <td>
              <a href="#">{x.name}</a>
            </td>
          </tr>)
        ));
      });
  }, []);
  return (
    <>
      <div className="row">
        <div className="col-12">
          <h1>All Books:</h1>
        </div>
      </div>
      <div className="row">
        <div className="col-12">
          <table className="table table-bordered mt-3">
            <thead>
              <tr>
                <th>Title</th>
              </tr>
            </thead>
            <tbody></tbody>
          </table>
        </div>
      </div>
    </>
  );
}

export default ListBooks;
